import React from 'react';
import ProductList from '../product-list';
import './cell-list.css';

const fakeData = [
  { barcode: 123, productlist: [
    { product_barcode: 'aaasdsd', amount: 400 },
    { product_barcode: 'asdfdsf', amount: 200 }
  ]},
  { barcode: 341, productlist: [
    { product_barcode: 'aaasdsd', amount: 400 },
    { product_barcode: 'asdfdsf', amount: 200 }
  ]}
];

const CellList = () => {
  return (
    <div className="cell-list">
      <ul>
        {
          fakeData.map(
            (({ productList }) => {
              return (
                <li>
                  <ProductList products={productList} />
                </li>
              )
            })
          )
        }
      </ul>
    </div>
  )
};

export default CellList;
